message:
สวัสดีค่ะ จากที่ท่านได้ทำการสอบถามข้อมูลล่าสุดเกี่ยวกับไฟล์เสียงในการให้บริการนั้น  จากที่ได้ทำการตรวจสอบข้อมูลที่มีการส่งเรื่องประสานงานกับทางศูนย์บริการ ทรูช้อป พาราไดซ์ พาร์ค ศรีนครินทร์  ซึ่งในส่วนของนโยบายของทางทรูจะยังไม่มีสิทธิพิเศษส่วนลดค่าบริการ 50% ตลอดอายุการใช้งานนะคะ    ซึ่งสามารถดำเนินการมอบเป็นสิทธิพิเศษได้สูงสุด  24 เดือนตามที่เจ้าหน้าที่ทำการแจ้งก่อนหน้านั้นค่ะ
/// กุไม่ต้องการให้ตอบ  กุต้องการไฟล์เสียงเพื่อเป็นหลักฐาน   ที่เหลือกุจะจัดการเอง
///คอลเซ็นเตอร์คนล่าสุดที่ชื่อ สุพรรณี  ตามเรื่องแบบไหนตั้งแต่วันเสาร์ถึงเงียบหายไปเลย   บอกเขาพรุ่งนี้รอตอบคำถามกุ

